import React from "react";
import CardContent from "@material-ui/core/CardContent";
import CardActions from "@material-ui/core/CardActions";
import { makeStyles } from "@material-ui/core/styles";
import { BrowserRouter as Route, Link } from "react-router-dom";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CssBaseline from "@material-ui/core/CssBaseline";
import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import Container from "@material-ui/core/Container";
import "./App.css";
import NavAS from "./navAfterSU";

class UserMain extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: []
    };
    var that = this;
  }
  componentDidMount() {
    var that = this;
    var id = window.location.href.split("=")[1];
    $.ajax({
      url: "http://localhost:8000/",
      type: "GET",
      dataType: "JSON",
      success: function(data) {
        //   console.log(data);
        that.setState({ data: data });
        console.log(that.state.data);
      },
      error: function(err) {
        console.log(err);
      }
    });
  }
  render() {
    console.log(this.state.data);
    const listItems = this.state.data.map(mainSchema => (
      <div>
        <img className="img" src={mainSchema.mainComImg}></img>
        <p>{mainSchema.mainComDis}</p>
        <button>
          <Link to={`/${mainSchema.id}`}>EXPLORE MORE</Link>
        </button>{" "}
        <br></br>
        <br></br>
      </div>
    ));
    return (
      <div>
        <Link to="/ProceedToCheckout">
          <Button>ProceedToCheckout</Button>
        </Link>
        <Navbar />
        <ul className="yara">{listItems}</ul>
        <Footer />
      </div>
    );
  }
}

export default UserMain;
